import React from 'react';
import {Link} from 'react-router-dom'

class Home extends React.Component {
  state = {
    login: "",
    password: "",
    checkLogPas: false
  }
  signOut = (field) => event => {
    this.setState({ [field]: false })
  }
  render () {
    return (
      <div>
        Home
        <Link to="/auth">Home</Link>
      </div>
    )
  }
}

export default Home;
